"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:10pt; font-weight:600; text-decoration: underline;\">Breadth First Search (BFS):</span><span style=\" font-size:10pt; font-weight:600;\"><br /></span><span style=\" font-size:10pt;\">Time Complexity: </span><span style=\" font-size:10pt; font-weight:600;\">O(V + E)</span><span style=\" font-size:10pt;\">, where </span><span style=\" font-size:10pt; font-weight:600;\">V</span><span style=\" font-size:10pt;\"> is the number of vertices and </span><span style=\" font-size:10pt; font-weight:600;\">E</span><span style=\" font-size:10pt;\"> is the number of edges in the graph. </span><span style=\" font-size:10pt; font-weight:600;\"><br /></span><span style=\" font-size:10pt;\">Space Complexity: </span><span style=\" font-size:10pt; font-weight:600;\">O(V)</span><span style=\" font-size:10pt;\">, where </span><span style=\" font-size:10pt; font-weight:600;\">V </span><span style=\" font-size:10pt;\">is the number of vertices in the graph.</span></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:10pt; font-weight:600;\"><br /></span><span style=\" font-size:10pt; font-weight:600; text-decoration: underline;\">Depth First Search (DFS):</span><span style=\" font-size:10pt; font-weight:600;\"><br /></span><span style=\" font-size:10pt;\">Time Complexity:  </span><span style=\" font-size:10pt; font-weight:600;\">O(V + E),</span><span style=\" font-size:10pt;\"> where </span><span style=\" font-size:10pt; font-weight:600;\">V</span><span style=\" font-size:10pt;\"> is the number of vertices and</span><span style=\" font-size:10pt; font-weight:600;\"> E</span><span style=\" font-size:10pt;\"> is the number of edges in the graph.</span></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:10pt;\">Space Complexity: </span><span style=\" font-size:10pt; font-weight:600;\">O(V)</span><span style=\" font-size:10pt;\">, where </span><span style=\" font-size:10pt; font-weight:600;\">V </span><span style=\" font-size:10pt;\">is the number of vertices in the graph.</span><span style=\" font-size:10pt; font-weight:600;\"><br /><br /></span><span style=\" font-size:10pt; font-weight:600; text-decoration: underline;\">Dijkstra\'s Algorithm:</span><span style=\" font-size:10pt; font-weight:600;\"><br /></span><span style=\" font-size:10pt;\">Time Complexity: </span><span style=\" font-size:10pt; font-weight:600;\">O((V + E) log V) </span><span style=\" font-size:10pt;\">where </span><span style=\" font-size:10pt; font-weight:600;\">V</span><span style=\" font-size:10pt;\"> represents the number of vertices and </span><span style=\" font-size:10pt; font-weight:600;\">E</span><span style=\" font-size:10pt;\"> represents the number of edges in the graph.</span></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:10pt;\">Space Complexity: </span><span style=\" font-size:10pt; font-weight:600;\">O(V)<br /><br /></span><span style=\" font-size:10pt; font-weight:600; text-decoration: underline;\">Prim\'s:</span></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:10pt;\">Time Complexity: </span><span style=\" font-size:10pt; font-weight:600;\">O((V +E) log V)</span><span style=\" font-size:10pt;\"> using an </span><span style=\" font-size:10pt; font-weight:600;\">adjacency list</span><span style=\" font-size:10pt;\">, where </span><span style=\" font-size:10pt; font-weight:600;\">V</span><span style=\" font-size:10pt;\"> is the number of vertices and </span><span style=\" font-size:10pt; font-weight:600;\">E</span><span style=\" font-size:10pt;\"> is the number of edges in the graph.</span></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:10pt;\">Space Complexity: </span><span style=\" font-size:10pt; font-weight:600;\">O(V+E)</span></p>\n"
"<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-size:10pt;\"><br /></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:10pt; font-weight:600; text-decoration: underline;\">Naive Search Algorithm:</span><span style=\" font-size:10pt; font-weight:600;\"><br /></span><span style=\" font-size:10pt;\">Time Complexity:</span><span style=\" font-size:10pt; font-weight:600;\"> O(m*n) </span><span style=\" font-size:10pt;\">where </span><span style=\" font-size:10pt; font-weight:600;\">n</span><span style=\" font-size:10pt;\"> represents the length of the text and </span><span style=\" font-size:10pt; font-weight:600;\">m</span><span style=\" font-size:10pt;\"> represents the length of the pattern being searched for.<br />Space Complexity</span><span style=\" font-size:10pt; font-weight:600;\"> : O(1)<br /></span></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:10pt; font-weight:600; text-decoration: underline;\">Rabin-Karp:</span></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:10pt;\">Time Complexity: </span><span style=\" font-size:10pt; font-weight:600;\">O(n+m), </span><span style=\" font-size:10pt;\">Worst Case: </span><span style=\" font-size:10pt; font-weight:600;\">O(n*m), </span><span style=\" font-size:10pt;\">where </span><span style=\" font-size:10pt; font-weight:600;\">n</span><span style=\" font-size:10pt;\"> represents the length of the text and </span><span style=\" font-size:10pt; font-weight:600;\">m</span><span style=\" font-size:10pt;\"> represents the length of the pattern.</span></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:10pt;\">Space Complexity: </span><span style=\" font-size:10pt; font-weight:600;\">O(m)</span></p>\n"
"<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-size:10pt;\"><br /></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:10pt; font-weight:600; text-decoration: underline;\">Knuth-Morris-Pratt (KMP):</span></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:10pt;\">Time Complexity: </span><span style=\" font-size:10pt; font-weight:600;\">O(n + m)</span><span style=\" font-size:10pt;\">, where </span><span style=\" font-size:10pt; font-weight:600;\">n</span><span style=\" font-size:10pt;\"> is the length of the text and </span><span style=\" font-size:10pt; font-weight:600;\">m</span><span style=\" font-size:10pt;\"> is the length of the pattern.</span></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:10pt;\">Space Complexity: </span><span style=\" font-size:10pt; font-weight:600;\">O(m)</span></p>\n"
"<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-size:10pt;\"><br /></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:10pt; font-weight:600; text-decoration: underline;\">P vs. NP:</span></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:10pt; font-weight:600;\">P</span><span style=\" font-size:10pt;\">, or </span><span style=\" font-size:10pt; font-weight:600;\">polynomial time</span><span style=\" font-size:10pt;\"> problems are problems that are fast to solve while </span><span style=\" font-size:10pt; font-weight:600;\">NP</span><span style=\" font-size:10pt;\">, or </span><span style=\" font-size:10pt; font-weight:600;\">nondeterministic polynomial time</span><span style=\" font-size:10pt;\"> problems are problems that are fast to verify.</span></p>\n"
